    private static Block registerStairsBlock(String id, Block base) {
        return Blocks.register((String)id, (T settings) -> new StairsBlock(base.getDefaultState(), settings), (AbstractBlock.Settings)AbstractBlock.Settings.copy((AbstractBlock)base));
    }

    private static AbstractBlock.Settings copyLootTable(Block block, boolean copyTranslationKey) {
        AbstractBlock.Settings settings = AbstractBlock.Settings.create().lootTable(block.getLootTableKey());
        if (copyTranslationKey) {
            settings = settings.overrideTranslationKey(block.getTranslationKey());
        }
        return settings;
    }

    public static Block register(RegistryKey<Block> key, Function<AbstractBlock.Settings, Block> factory, AbstractBlock.Settings settings) {
        Block block = factory.apply(settings.registryKey(key));
        return (Block)Registry.register((Registry)Registries.BLOCK, key, (Object)block);
    }

    public static Block register(RegistryKey<Block> key, AbstractBlock.Settings settings) {
        return Blocks.register(key, Block::new, (AbstractBlock.Settings)settings);
    }

    private static RegistryKey<Block> keyOf(String id) {
        return RegistryKey.of((RegistryKey)RegistryKeys.BLOCK, (Identifier)Identifier.ofVanilla((String)id));
    }

    private static Block register(String id, Function<AbstractBlock.Settings, Block> factory, AbstractBlock.Settings settings) {
        return Blocks.register((RegistryKey)Blocks.keyOf((String)id), factory, (AbstractBlock.Settings)settings);
    }

    private static Block register(String id, AbstractBlock.Settings settings) {
        return Blocks.register((String)id, Block::new, (AbstractBlock.Settings)settings);
    }

    static {
        for (Block block : Registries.BLOCK) {
            for (BlockState blockState : block.getStateManager().getStates()) {
                Block.STATE_IDS.add((Object)blockState);
                blockState.initShapeCache();
            }
        }
    }
